import { makeStyles } from "@mui/styles";

const ChatBoxStyle = makeStyles({
    Content: {
        height: "100%",
        userSelect: "none",
        display: "flex",
        flexDirection: "Column",
        alignItems: "center",
        justifyContent: "center",
        verticalAlign: "middle",
    },
})

export default ChatBoxStyle;
